import {Drawer} from "@mui/material";



const drawerstyle={
    left:20,
    top:17,
}

const InfoDrawer=({open,setopen})=>{
    const handleClose=()=>{
        setopen(false);
    }
    return(
        <Drawer open={open} onclose={handleClose} PaperProps={{sx:drawerstyle}} style={{}}>
            Hello
        </Drawer>
    )
}
export default InfoDrawer;
